import React from 'react'
import classes from "./SimpleModel.module.css"

const SimpleModal = ({children, }) => {
  return (
    <div className={[classes.sympleModal, classes.sympleModal_active].join(" ")}>
      <div className={classes.sympleModalContent}>
        {children}
      </div>
    </div>
  )
}

export default SimpleModal
